import React from 'react'

class Graph extends React.Component {

  constructor (props){

    super(props)
  }

  render() {

    const data = this.props.data;
    const angles = this.props.angle;

    return (
      <Polar
        data={datas}
        options={{
          legend: {
              display: true,
              position: 'right'
            },
            elements: {
              arc: {
                angle: this.divvy(6.28318530718, 17, 0.02)
              }
            }
          }}
      />
    )
  }

}

export default Graph
